title:
Gezicht buyten de Schalkwijker Poort te Haarlem ziende langs de Somervaart / [door] W.Hendriks. - [ca.1800]. - 1 tekening op papier : potlood, pen in zwart en penseel in kleuren ;
          blad 19,8 x 29,9 cm. Titel en signatuur WHs. op de versozijde. - Afgebeeld is de Zomervaart vanaf de Schalkwijkerstraat, ziende naar het oosten. - Herkomst: geschonken in 1885 door
          Mr.H.Gerlings Cz.
